import Nav from '../components/navbar';
import Foot from '../components/footer';
import React, { useState } from 'react';

function About() {

  const initialValues = {
    trans: "Transmission",
    auto: "Auto Repair"
  }


  return (
    <>
    <div id="aboutwrapper">
      <Nav />
        <ul id="services">
          <li>{initialValues.trans}</li>
          <li>{initialValues.auto}</li>
        </ul>

      <style jsx>{`
        #aboutwrapper {
          float: left;
          width: 100%;
          background: url('/background_about.jpg');
          background-size: cover;
          padding-top: 200px;
          padding-bottom: 200px;
        }
        #services {
          float: left;
          width: 40%;
          padding: 10px;
          box-shadow: 0 0 5px gray;
        }
        #services li {
          float: left;
          width: 100%;

        }
        `}</style>
    </div>
    <Foot />
    </>
  );
}

export default About;
